const SearchNew = () => {
  return (
    <div class='row'>
      <h3>SearchNew</h3>
      <form class='col'>
      <div class="row">
        <div class="input-field col s12">
          <input id="password" type="password" class="validate" />
          <label for="password"></label>
        </div>
      </div>
      </form>
    </div>
  );
};

export default SearchNew;
